  false,\n\t\"url\": null,\n\t\"notes\": \"Little is known about the vegetation structure
  and composition of prairie-woodland transition areas at Des Lacs National Wildlife
  Refuge (DLNWR) in northwestern North Dakota Woodlands comprise close to 20% of the
  upland habitat at DLNWR. Most are narrow and linear, however, making transition
  areas a substantial component of the landscape, which otherwise is dominated by
  prairie. Transition areas can be manipulated in order to impede or encourage succession.
  Knowledge of the current habitat characteristics, and the effects of grazing, prescribed
  burning, and long-term rest on the extent of these areas is needed for future management
  decisions. Objectives of our work were to (I) quantitatively describe prairiewoodland
  transition areas at DLNWR, and (2) establish reference points for assessing trends
  in vegetation.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
